import React, { useState } from 'react'
import Menu from "./Manu";
import Cards from "./cards";

const App = () => {
  const [data, setData] = useState(Menu)
  return (
    <>
    <div className="navigation">
      <div className="nav-btn-group">
        <button className="navbtn">dfsdf</button>
        <button className="navbtn">ggdsa</button>
        <button className="navbtn">ffdfd</button>
        <button className="navbtn">vvdvv</button>
      </div>
    </div>
     <Cards data={data}/>
    </>
  )
}

export default App
